import { Link } from "react-router-dom";
import './barraArriba.css';

//ESCONDERLE UN BOTÓN TRASNPARENTE EN AL NOMBRE DE LA PÁG O SACAR EL NOMBRE Y PONERLO DESDE CSS Y HTML COMO LINK!s

export default function barraArriba () {
    return (
        <div >

            <div >

                <nav className="barra">
                <Link to='/home' id="click">
                  <button className="botonName"></button>
                </Link>
                </nav>    
            </div>

        </div>
    )
}
